import SideNavComponent from '../SideNavComponent'




const Wrapper = styled.section `
    height:100%
    overflow:scroll;
`
const InnerWrapper = styled.div `
overflow:scroll;
    text-align: center;
    color:red;
`
const SideNav = styled.nav `
    font-weight: bold;
	padding: 1.5em;
	font-size: 120%;
	padding: 0px;
	text-align: center;
`
const MainDiv = styled.div `

`
class MediaComponent extends React.Component {

  render() {
    return (
        <Wrapper>
            <MainDiv>
                <SideNav>
                    <Link to="/home">
                        <p>Photos</p>
                    </Link>
                    <Link to="/home">
                        <p>Videos</p>
                    </Link>
                </SideNav>
            </MainDiv>
        </Wrapper>
    )
  }
}

export default withRouter(MediaComponent);
